import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Locate the search input and type a partial query
    const searchInput = page.locator('#searchInput');
    await searchInput.type('iph', { delay: 100 }); // Use delay to allow JS to trigger

    // Wait for the autocomplete suggestions to appear
    await page.waitForSelector('.search-suggestions', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_suggestions_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_suggestions_visible.png'));

    // Select the first suggestion
    const firstSuggestion = page.locator('.suggestion-item').first();
    const suggestionText = await firstSuggestion.textContent();
    await firstSuggestion.click();

    // Verify the input value has been updated
    const finalInputValue = await searchInput.inputValue();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_suggestion_selected.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_suggestion_selected.png'));

    return {
      success: true,
      action: "Tested search autocomplete by typing a query, waiting for suggestions, and selecting one.",
      extractedData: {
        typedQuery: 'iph',
        selectedSuggestion: suggestionText,
        finalInputValue: finalInputValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to test search autocomplete",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
